const Nav = () => {
	return (
		<div className='nav'>
			<nav>
				<p>
					<a>Профиль</a>
				</p>
					<a>Сообщения</a>
					<a>Новости</a>
					<a>Музыка</a>
					<a>Настройки</a>
				
			</nav>
		</div>
	);
}

export default Nav;
